&lt;div style=&quot;text-align: center&quot;&gt;출산을&amp;nbsp;하면서 생기는 &amp;nbsp;여자들의 고민 요실금 &lt;/div&gt;
&lt;div style=&quot;text-align: center&quot;&gt;특히 임산부 요실금은 아이를 출산 한 임산부들이 흔하게 겪는 고민이에요&lt;/div&gt;
&lt;div style=&quot;text-align: center&quot;&gt;호르몬 변화로 방광에 무리가 가서&amp;nbsp; 요실금이 생기기도 하고 &lt;/div&gt;
&lt;div style=&quot;text-align: center&quot;&gt;태아로 인해서 자궁이 늘어나고&amp;nbsp;&amp;nbsp; 임신기간 태아의 무게와 출산으로 인해서&amp;nbsp;골방아래 근육이 &lt;/div&gt;
&lt;div style=&quot;text-align: center&quot;&gt;느슨해지면서 생기는 고민 &lt;/div&gt;
&lt;div style=&quot;text-align: center&quot;&gt;자연스러운 현상이라고 는 하지만 당황스러울거에요.&lt;/div&gt;
&lt;div style=&quot;text-align: center&quot;&gt;&amp;nbsp;얼마전에 후배가 고민을 해와서 추천해준 임산부 요실금패드 테나를 소개해요&lt;/div&gt;
